import React from 'react'
import './App.css';
import Output from './'


function App() {
  return (

    <div className="App">
     <Headline />
     <Output />

    </div>
  );

}

function Headline(){
  const greeting = 'Hello'
  return <h1>{greeting}</h1>
}


export default App;
